  \"2015-09-01T18:26:44.523930\",\n\t\"name\": \"understanding-the-rates-causes-and-costs-of-churning-in-the-supplemental-nutrition-assista\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This report describes \"churning\" as a
  policy concern in regards to the Supplemental Nutrition Assistance Program (SNAP).
  \ u201cChurningu201d in the Supplemental Nutrition Assistance Program (SNAP) is
  defined as when a household exits SNAP and then re-enters the program within 4 months.
  Churning is a policy concern due to the financial and administrative burden incurred
  by both SNAP households and State agencies that administer SNAP. This study explores
  the circumstances of churning in SNAP by determining the rates and patterns of churn,
  examining the causes of caseload churn, and calculating costs of churn to both participants
  and administering agencies in six States.\",\n\t\"license_title\": \"Creative Commons
